(function(){$(document).ready(function(){var a=$("#usf-search");a.autocomplete({minLength:1,source:a.data("autocomplete-url")});$("#usf-filters-link").on("click",function(c){c.preventDefault();var b=$("#usf-filters-box");if(b.length){b.width($(this).closest("table").width());if(b.is(":visible")){b.slideUp()}else{b.slideDown()}}});$(".usf-filter-snippet").on("click",function(c){c.preventDefault();var b=$(this).find("code").text();a.val(a.val()+" "+b)})})})();